import { Component,  OnInit } from '@angular/core';
import { FormGroup, FormControl, FormArray, Validators, NgForm } from '@angular/forms';
@Component({
  selector: 'app-document-edit',
  templateUrl: './document-edit.component.html',
  styleUrls: ['./document-edit.component.css']
})
export class DocumentEditComponent implements OnInit {
originalDocument: Document;
document: Document;
editMode: boolean = false;
tsdocTitle = {"docTitle": "Whatever Title"}
tsdocDesc = {"docDesc": "Whatever Description"}
tsdocUrl = {"docUrl": "Whatever http://Url"}
tsWhat = true;
// tsdocUrl = {"docUrl": ""}
ngOnInit(): void {
}

onSubmit(f: NgForm) {
// console.log(f)
console.log(this.tsdocTitle)
console.log("Title Value is:", f.value.docTitle)
console.log("Description Value is:", f.value.docDesc)
console.log("Url Value is:", f.value.docUrl)
  }
}
